import {Link} from 'react-router-dom';

import { Box, Button } from '@mui/material';



export default function Main() {



  return (

    <Box>

      <Button><Link to='/employee'>LINK to employee</Link></Button>

      <Button><Link to='/product'>LINK to product</Link></Button>



    </Box>

  )



}
